import { Pill } from "./Pill";

export const WorkEntry = (props) => {
  const logo = props.logo;
  const title = props.title;
  const description = props.description;
  return (
    <div
      style={{
        width: "95%",
        border: "solid 1px #333",
        borderRadius: "4px",
        fontSize: 12,
        marginRight: 8,
        flexDirection: "row",
        display: "flex",
        padding: 16,
      }}
    >
      <img src={logo} style={{ width: 60, height: 60, padding: 16 }} />
      <div>
        <p>
          <Pill text={title} />
        </p>
        {description}
      </div>
    </div>
  );
};
